script: |
  super -f text -I q10320.spq | sort > q10320.out

inputs:
  - name: q10320.spq
    data: |
      SELECT DISTINCT + - ( COUNT ( * ) ) + + 13 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 BETWEEN 10 AND 13 * - col0;
  - name: tab0

outputs:
  - name: q10320.out
    data: |
      10
